import React from 'react';
import styled from 'styled-components';
import './App.css';

function App() {
  const Wrapper = styled.div`
  height:100%;
  width:100%;
  `

  return (
    <Wrapper>
    <h1>Rock, paper and scissors! </h1>
    </Wrapper>
  );
}

export default App;
